import classes from "./Services.module.css";

function ServicesPage() {
  return (
    <div className={classes.servicesBody}>
      <section>
        <h1 className={classes.servicesHeader}>Services</h1>
        <h3 className={classes.servicesHeader}>The OV Way</h3>
        <ul>Daily Recommendations and monitoring so you can stay on track!</ul>
        <ul>Free consultation</ul>
        <ul>4, 6, and 12 months options</ul>
        <ul>Weekly check-in meetings to collaborate, improve, and optimize</ul>
      </section>
    </div>
  );
}

export default ServicesPage;
